    console.log(t)
  return (
    <div> {t && t.data.map(tournament => <p>{tournament.attributes.name}</p>)} 
         <div> 
           {t && t.data.map(tournament => <p>{tournament.id}</p>)} 
         </div>
    </div>
  )
}

export default TournamentSelector
